import React from "react";
import { Route, Routes } from 'react-router-dom';
import About from "./About.jsx";
import Home from "./Home.jsx";
const App=()=>{
  return(
      <Routes>
        <Route path="/" element={<About/>}/>
        <Route path="/Home" element={<Home/>}/>
      </Routes>
  )
}

export default App;
